import React,{useState} from 'react'
import {useDispatch , useSelector} from 'react-redux';
import {useHistory} from 'react-router-dom';
import { TextField, Button, Typography, Paper} from '@material-ui/core';
import './Seller.css';
import {register} from '../../actions/Seller.js';
const Seller = () => {

    const [details,setDetails] = useState({
        name: '', email:'',number:'',address:'',pincode:'',type:''
    });
    const dispatch = useDispatch();
    const history = useHistory();

    const handleSubmit = (e) => {

        e.preventDefault();
        //console.log(details);

        dispatch(register({...details}, history));

        setDetails({
            name: '', email:'',number:'',address:'',pincode:'',type:''
        })

    }

    const seller_Details = useSelector((state) => state.allSeller);
    console.log(seller_Details);



    return (
        <div className='main_container'>
            <div>
            <h1> Please Enter All the Details to be a Registered Seller</h1>
            </div>

            <div>
            <form onSubmit={(e) => handleSubmit(e)}>
                <div className="form_fields">
                <TextField name="name" className="input" variant="filled" label="Name"  color="primary" onChange={(e) => setDetails({...details,name: e.target.value})}/>
                <TextField name="email" className="input" variant="filled" label="Email"  onChange={(e) => setDetails({...details,email: e.target.value})}/>
                <TextField name="number" className="input" variant="filled" label="Number"  onChange={(e) => setDetails({...details,number: e.target.value})}/>
                <TextField name="address" className="input" variant="filled" label="Address"  onChange={(e) => setDetails({...details,address: e.target.value})}/>
                <TextField name="pincode" className="input" variant="filled" label="Pincode"  onChange={(e) => setDetails({...details,pincode: e.target.value})}/>
                <TextField name="type" className="input" variant="filled" label="Grocery/Medical"  onChange={(e) => setDetails({...details,type: e.target.value})}/>
                <Button type='submit' className="input" variant="contained" color="primary">Submit</Button>
                </div>
            </form>
            </div>
        </div>
    )
}

export default Seller
